uniform float iTime;
uniform vec2 iResolution;

// 12 Locked-In Stability Parameters
uniform float u_zoom;           // Default: 1.5
uniform float u_camera_dist;    // Default: 10.0 (Safety Distance)
uniform float u_camera_height;  // Default: 2.5
uniform float u_complexity;     // Default: 0.8 (Lower = Safer)
uniform float u_melt_speed;     // Default: 0.4
uniform float u_chrome_shine;   // Default: 1.2
uniform float u_exposure;       // Default: 1.5
uniform float u_glow_power;     // Default: 1.0
uniform float u_hue_cycle;      // Default: 0.2
uniform float u_fog_depth;      // Default: 30.0
uniform float u_chroma;         // Default: 0.02
uniform float u_vignette;       // Default: 0.5

out vec4 fragColor;

mat2 rot(float a) { return mat2(cos(a), -sin(a), sin(a), cos(a)); }

// Simplified Stable Fractal Math
float map(vec3 p) {
    float t = iTime * u_melt_speed;
    p.xz *= rot(t * 0.2);
    p.xy *= rot(t * 0.1);

    float d = 100.0;
    float s = 1.0;

    for(int i = 0; i < 3; i++) { // Reduced iterations for stability
        p = abs(p) - 0.7;
        p.xz *= rot(t * 0.3 + float(i));

        float r2 = dot(p, p);
        // Safety Clamp: Prevents divide-by-zero black screens
        float k = (1.2 * u_complexity) / clamp(r2, 0.2, 1.0);
        p *= k;
        s *= k;

        d = min(d, (length(p) - 0.9) / s);
    }
    return d;
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0);
    return normalize(vec3(map(p+e.xyy)-map(p-e.xyy), map(p+e.yxy)-map(p-e.yxy), map(p+e.yyx)-map(p-e.yyx)));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // --- STABLE CAMERA RIG ---
    // High-angle pullback to guarantee we don't start inside the object
    float orbit = iTime * 0.1;
    vec3 ro = vec3(sin(orbit) * u_camera_dist, u_camera_height, cos(orbit) * u_camera_dist);
    vec3 ta = vec3(0, 0, 0);

    vec3 fwd = normalize(ta - ro);
    vec3 side = normalize(cross(vec3(0, 1, 0), fwd));
    vec3 up = cross(fwd, side);
    vec3 rd = normalize(fwd * u_zoom + uv.x * side + uv.y * up);

    // --- AGGRESSIVE MARCHING ---
    float dist = 0.1, d, glow = 0.0;
    for(int i = 0; i < 70; i++) {
        vec3 p = ro + rd * dist;
        d = map(p);

        // Safety Glow
        glow += exp(-max(d, 0.0) * 3.0) * u_glow_power;

        if(d < 0.002 || dist > 40.0) break;
        dist += d * 0.5; // Slow steps for extreme accuracy
    }

    vec3 col = vec3(0.005, 0.008, 0.02); // Deep Space background

    if(dist < 40.0) {
        vec3 p = ro + rd * dist;
        vec3 n = getNormal(p);
        vec3 v = normalize(ro - p);

        float diff = max(dot(n, normalize(vec3(1, 2, 3))), 0.0);
        float fres = pow(1.0 - max(dot(n, v), 0.0), 4.0);

        // Metallic Shading
        vec3 baseCol = mix(vec3(0.7, 0.8, 0.9), vec3(1.0, 0.7, 0.3), u_hue_cycle);
        col = baseCol * diff * 0.5;
        col += baseCol * fres * u_chrome_shine;
        col += vec3(1.0) * pow(max(dot(n, normalize(vec3(1, 4, 2))), 0.0), 32.0);
    }

    // Atmospheric Polish
    col += glow * 0.02 * mix(vec3(0.5, 0.2, 1.0), vec3(1.0, 0.5, 0.2), u_hue_cycle);
    float fog = 1.0 - exp(-dist * (1.0 / u_fog_depth));
    col = mix(col, vec3(0.01, 0.01, 0.02), fog);

    // Post-Process
    col *= u_exposure;
    col.g *= (1.0 - u_chroma);
    col.b *= (1.0 + u_chroma);

    col = pow(smoothstep(-0.05, 1.25, col), vec3(0.4545));
    col *= 1.2 - length(uv) * u_vignette;

    fragColor = vec4(clamp(col, 0.0, 1.0), 1.0);
}

